import "./App.css";
import { getMovieList, searchMovie } from "./api";
import { useEffect, useState } from "react";

const App = () => {
  const [popularMovies, setPopularMovies] = useState([]);

  useEffect(() => {
    setPopularMovies(getMovieList());
  }, []);

  const search = (q) => {
    console.log({ q });
  };

  console.log({ popularMovies: popularMovies });

  return (
    <div className="App">
      <header className="App-header">
        <h1>Zaki nih woy</h1>
        <input
          type="text"
          placeholder="Cari Film Kesukaan..."
          className="Movie-search"
          onChange={({ target }) => search(target.value)}
        />
        <div className="Movie-container">
          <div className="Movie-wrapper">
            <div className="Movie-title">Contoh Pertama</div>
            <img src="" alt="" className="Movie-image" />
            <div className="Movie-date">03-03-2000</div>
            <div className="Movie-rate">9.6</div>
          </div>
        </div>
      </header>
    </div>
  );
};

export default App;
